import React, { Suspense } from 'react';
import { Canvas } from '@react-three/fiber';
import { OrbitControls, useGLTF } from '@react-three/drei';

function LabModel() {
  // Make sure this path matches your public folder structure:
  // public/models/lab-model.glb
  const { scene } = useGLTF('./models/lab-model.glb');
  return <primitive object={scene} />;
}

export default function LabModelWrapper() {
  return (
    <div style={{ height: 500, width: '100%' }}>
      <Canvas camera={{ position: [0, 2, 5], fov: 50 }}>
        <ambientLight intensity={0.5} />
        <directionalLight position={[5, 5, 5]} intensity={1} />
        <Suspense fallback={<span style={{ color: 'white' }}>Loading 3D Model...</span>}>
          <LabModel />
        </Suspense>
        <OrbitControls />
      </Canvas>
    </div>
  );
}
